import React, { Component } from 'react'
import BasePage from './BasePage'
import styles from '../base.css';

export default class BasePageWithCard extends Component {
  render() {
    return (
      <BasePage>
      <div className={styles.card}>
       {children}
       </div>
      </BasePage>
    )
  }
}
